import React, { useState } from 'react';
import './UserPanel.css';

const UserPanel = ({ user }) => {
  const [phone, setPhone] = useState(user.phone || '');
  const [password, setPassword] = useState('');
  const [requests, setRequests] = useState([]);
  const [newRequest, setNewRequest] = useState('');

  const handleUpdateInfo = () => {
    alert('Bilgiler güncellendi!');
  };

  const handleRequestSubmit = () => {
    if (newRequest.trim() === '') return;
    setRequests([...requests, { text: newRequest, reviewed: false }]);
    setNewRequest('');
  };

  const handleReview = (index) => {
    const updated = [...requests];
    updated[index].reviewed = true;
    setRequests(updated);
  };

  return (
    <div className="user-panel-container">
      <h2 className="welcome-message">Hoş geldin, {user.name}</h2>
      
      <div className="user-panel-sections">
        
        {/* Sol: Profil */}
        <div className="panel-section left-panel">
          <h4>Profil Bilgileri</h4>
          <p><strong>Ad:</strong> {user.name}</p>
          <p><strong>Soyad:</strong> {user.surname}</p>
          <p><strong>Email:</strong> {user.email}</p>
          <p><strong>Lisanslar:</strong> {user.licenses?.join(', ') || 'Yok'}</p>
          
          <div className="input-group">
            <label>Telefon:</label>
            <input value={phone} onChange={(e) => setPhone(e.target.value)} />
          </div>
          <div className="input-group">
            <label>Şifre:</label>
            <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
          </div>
          <button className="update-btn" onClick={handleUpdateInfo}>Güncelle</button>
        </div>

        {/* Orta: Talep Oluştur */}
        <div className="panel-section center-panel">
          <h4>Destek Talebi Oluştur</h4>
          <textarea
            value={newRequest}
            onChange={(e) => setNewRequest(e.target.value)}
            placeholder="Destek talebinizi buraya yazın..."
          />
          <button className="request-btn" onClick={handleRequestSubmit}>Gönder</button>
        </div>

        {/* Sağ: Geçmiş Talepler */}
        <div className="panel-section right-panel">
          <h4>Geçmiş Talepler</h4>
          {requests.length === 0 ? (
            <p>Henüz talep yok.</p>
          ) : (
            <ul>
              {requests.map((req, index) => (
                <li key={index}>
                  {req.text}
                  <br />
                  <small>
                    Durum: {req.reviewed ? 'Değerlendirildi' : 'Beklemede'}
                  </small>
                  {!req.reviewed && (
                    <button onClick={() => handleReview(index)}>Değerlendir</button>
                  )}
                </li>
              ))}
            </ul>
          )}
        </div>

      </div>
    </div>
  );
};

export default UserPanel;
